<html><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8" /><link rel="stylesheet" type="text/css" href="rtwreport.css" /><script language="JavaScript" type="text/javascript">
/*<![CDATA[*/
function rtwTableShrink(obj, id, isSymbol){
  if (isSymbol) {
    hide = "[-]";
    hide_text = hide;
    show = "[+]";
    show_text = show;
  } else {
    hide = "[<u>hide</u>]";
    hide_text = "[hide];"
    show = "[<u>show</u>]";
    show_text = "[show]";
  }
  if (window.document.getElementsByName) {
    var o = window.document.getElementsByName(id);
    for (var oid = 0; oid < o.length; ++oid) {
      if (o[oid].style.display == "none") {
        o[oid].style.display =  "";
      } else {
        o[oid].style.display = "none";
      }
    }
  }
  if (obj.textContent)
     var objText = obj.textContent;
  else
     var objText = obj.innerText;
  if (objText.toLowerCase() == show_text.toLowerCase())
     obj.innerHTML = hide; 
  else 
     obj.innerHTML = show; 
}
/*]]>*/
</script>
